import React from 'react';

const Order = (props) => {
let orders;
console.log(props.orderList)
  if ( props.orderList.length === 0 ){

     orders=(
        <h4 className="empty_list">YOU HAVE NO ORDER LIST </h4>
    )
  }else {
     orders =props.orderList.map((order)=>{
        return (
            <div className="headings" key={order.order_id}> 
                <p className="order_id">id</p>
                <p className="receiver_name">receivers name</p>
                <p className="receiver_phone_no">number</p>
                <p className="pickup_address">pickup</p>
                <p className="destination_address">destination</p>
                <p className="order_date">date</p>
                <p className="status">status</p>
                <p className="c_location">location</p>


            </div>

        )}
        )
  }




    return (
        <div>
         <div className="headings">
                <p className="order_id">ORDER ID</p>
                <p className="receiver_name">RECEIVERS NAME</p>
                <p className="receiver_phone_no">RECEIVERS PHONE NO</p>
                <p className="pickup_address">PICKUP ADDRESS</p>
                <p className="destination_address">DESTINATION ADDRESS</p>
                <p className="order_date">ORDER DATE</p>
                <p className="status">STATUS</p>
                <p className="c_location">CURRENT LOCATION</p>


            </div>
           {orders} 
        </div>
    );
}

export default Order;
